import React, { useState } from "react";

const state = useState();

let count = 0;
const IncNum = () => {
    count++;
    console.log("Clicked "+ count);
}

const App = () =>{
    return(
        <>
            <h1> {count} </h1>
            <button onClick = {IncNum}> Click Me</button>
        </>
    );
};

export default App;
